Partial functions are somewhat similar to function composition, but we define a function to a subset of the possible values that it can receive, as if it was using a constant value instead of a function. In this case, I want to extrapolate partial functions from Clojure's partial function. Clojure's partial is a core language utility that allows to pre-fill arguments to a function, creating a new function with fewer parameters. Could say that it is quite common for testing Dal like structures that require a lot of configuration. So let's consider the following example: (defn multiply [a b] (* a b)) (def multiply-by-three (partial multiply 3)) (println (multiply-by-three 4)) ; Output: 12 We have the function multiply, but we only care about the case where multiply has the first element set to 3, binding it as multiply-by-three from (partial multiply 3), then we can just call it (multiply-by-three 4). The caveat from Clojure side is that partial can only be applied to the first n arguments, while Rust gives you a bit more control over that. The following Rust code is a translation of the previous Clojure code with a twist of having the partial applied to the second argument, demonstrating how Rust enables a bit more control over this: fn multiply(a: i32, b: i32) -> i32 { a * b
} fn partial_multiply(b: i32) -> impl Fn(i32) -> i32 { move |a| multiply(a, b)
} fn main() { let multiply_by_four = partial_multiply(4); println!("Result: {}", multiply_by_four(3)); // Output: 12
} multiply function is exactly the same. However, the partial application of multiply, shifts which argument we are applying the partiality, as we create multiply_by_four applying partial_multiply to b, instead of a. Note that we can apply multiply_by_four multiple times and always having the guarantee that we will multiply by 4. Use Cases of Partial Functions Pre-binding Arguments : Useful when testing functions that require a lot of configuration, or event-driven architectures where some functions take repetitive arguments over and over. Currying Simulation : Breaking down multi-argument functions into simpler, single-argument functions. Code Reusability : Creating specific versions of generic functions, useful for simplifying test cases as well.

