This is a pretty straight forward problem, you have a vector of elements, where all elements are larger or equal to zero and you need to identify the maximum and the minimum of this vector. You can achieve this by iterating over all elements and preserving the minimum and the maximum difference for each element. In a procedural approach, this would mean: pub fn max_profit(prices: Vec<i32>) -> i32 { let mut min = i32::MAX; let mut max_profit = 0; for value in prices { min = value.min(min); max_profit = max_profit.max(value - min); } max_profit
} So, we create two variables to control min, which starts as anything above 104 (second constraint, but i32::MAX works beyond that constraint) and max_profit, that should start as zero in case we do not find any maximum value. Then we loop over all elements and reassign min and max_profit for the current value. Definitvely works, and is quite uncomplex solution with constant value allocation and a simple loop over n (prices.len()). Now we need to transition this to a functional solution, which in this case is have an iterator consumer and immutable data : pub fn max_profit(prices: Vec<i32>) -> i32 { prices .iter() .fold((i32::MAX, 0), |(min, max_profit), &value| { (value.min(min), max_profit.max(value - min)) }) .1
} To begin, we create an iterator, prices.iter(), then we consume this iterator with a fold, where the accumulator is a tuple consisting of the minimal value, same as before, and a maximum profit starting as 0. Then, in the fold loop, we already return a tuple containing the new minimum, value.min(min), as the first element, and the new maximum profit max_profit.max(value - min), as the second element. After we have consumed all the iterator, just return the second element of the resulting tuple. Benchmark wise both solutions were equivalent in execution time and memory using criterion and memory-stats crates.

