This problem is a bit more flexible as we can buy and sell in the same day, which means we can use a method that traverses the vector two by two, windows. This method allows us to traverse the following array [1, 2, 3, 4], in the following manner [[1, 2], [2, 3], [3,4]]. This means that for the example [7,1,5,3,6,4], we get the following results [[7,1], [1,5], [5,3], [3,6], [6,4]], if we filter out the results where the second element is smaller than the first we get [[1,5], [3,6]], which means a maximum profit of (5 - 1) + (6 - 3). This works well even with se quentially increasing number like [1, 2, 3, 4, 5, 6, 7]. Considering this, the trivial answer would be: pub fn max_profit(prices: Vec<i32>) -> i32 { prices.windows(2) .filter(|price| price[0] < price[1]) .map(|price| price[1] - price[0]) .sum()
} Where we iterate over prices two by two, filtering out all pairs where the second element is smaller than the first, so we map their difference and sum all the values. Note that sum starts at zero. Even if this is a good solution, I figured there is an even better approach to this, which results in one less line of code: pub fn max_profit(prices: Vec<i32>) -> i32 { prices.windows(2) .map(|price| 0.max(price[1] - price[0])) .sum()
} In this new solution, we replace the filter with a map operation that gets the maximum value between zero and the difference between prices (price[1] - price[0]). This means that if price[0] >= price[1], the map will return 0, allowing us to remove the filter line.

