we can start by doing a simple for loop that iterates over the range of elements (0..n), which means, all elements in nums2: pub fn merge(nums1: &mut Vec<i32>, m: i32, nums2: &mut Vec<i32>, n: i32) { for nums2_index in (0..n) { // ... }
