} With this, our array contains 2 sorted sections of arrays in nums1, so we could just call a simple rust sort there: pub fn merge(nums1: &mut Vec<i32>, m: i32, nums2: &mut Vec<i32>, n: i32) { for nums2_index in (0..n) { nums1[(m + nums2_index) as usize] = nums2[nums2_index as usize]; } nums1.sort();
} A final style touch to this code is that we don't need to pass a mutable reference to a Vec<i32>, we can just pass &mut &[i32]. Also, style wise, the correct way to express a range in a for loop is without (), so we should rewrite the for loop as for num2_index in 0..n: pub fn merge_naive(nums1: &mut [i32], m: i32, nums2: &mut [i32], n: i32) { for nums2_index in 0..n { nums1[(m + nums2_index) as usize] = nums2[nums2_index as usize]; } nums1.sort();
} According to benchmarks using criterion and memory-stats, for only the first example the execution time is around 7.8 ns and 40 KB of memory (all relative to my machine). For the largest example I have it has an execution time of 1 ms and a Memory consumption of 2.19 MB, not a bad start.

