Rust has a great function to solve this problem and to solve my problem with for loops, it is called splice. Splice receives a mutable reference to the vector, a range of points to splice (replace_with) the vector, and an IntoIterator to loop. The following code represents the solving of this problem with this function: pub fn merge(nums1: &mut Vec<i32>, m: i32, nums2: &mut Vec<i32>, n: i32) { let m = m as usize; let n = n as usize; nums1.splice(m..m+n, nums2.to_owned()); nums1.sort();
} One thing I don't like in this exact code is m+n range ending, as we could consider for this problem n+m == nums1.len(), so the whole function would look like: pub fn merge(nums1: &mut Vec<i32>, m: i32, nums2: &mut Vec<i32>, n: i32) { let m = m as usize; let _ = nums1.splice(m.., nums2.to_owned()); nums1.sort();
} Another take on this, would be to use the n variable with a take function, as well as simplify the use case of the & mut Vec<i32> where Vec is not needed: pub fn merge(nums1: &mut Vec<i32>, m: i32, nums2: &mut [i32], n: i32) { let m = m as usize; nums1.splice(m.., nums2.iter().copied().take(n as usize)); nums1.sort(); } This is about 10% more memory efficient and 10% less performatic than the for loop, that consumed around 40 KB for the first example, while this approach consumes only around 36 KB, for the largest test case. Performance wise, this approach being about 10% less performatic with 8.5 ns. Another interesting addition of using splice is that if we collect::<Vec<i32>>() the splice, we can return the exactly elements that were replaced by paying the allocation cost of a new Vec<i32>. " But Julia! you are using std functions to solve this problem! ". Yes! young padawan, why recreate the wheel? But if you really want, here is a guide: Check if the first m elements are 0, if they are, just replace them with nums2. Create an iterator for nums2. Loop over nums1, and if the next element in nums2 iterator is less of equal to the current element in nums1, insert it in the list and pop the last element. Get the next element in nums2 iterator. A pure functional approach in this problem is hard as we are dealing with mutability in nums1, but we could easily create a new vector from the originals ones and return it. This would be terrible memory wise as we are allocating a new vector full of new elements. For the previous guide, a more functional approach can be using fold and collecting the elements in a new vector. A pure functional way would require returning that list and avoiding mutability. However, that would fail leetcode test cases, so it will need to be assigned to nums1. I would risk saying that m and n are useless in a more functional Rust. If you need help, you can open an issue in the repo

