This is something that has been in my mind for a while, but recently a friend of mine asked how my project deals with unit testing functions that have side effects , and my answer was "Higher order functions and function composition". This is something that I have done to the Java/Clojure project we worked together at Thoughtworks some time ago, and I used it as a reminder to that friend. However, more than a reminder to them, I remembered a really old (2019) composition Rust project I did: fn compose<A, B, C, G, F>(f: F, g: G) -> impl Fn(A) -> C
where F: Fn(A) -> B, G: Fn(B) -> C,
{ move |x| g(f(x))
} fn main() { let add_and_multiply = compose(|x| x * 3f32, |x| x + 3f32); let divide_and_subtract = compose(|x| x / 3f32, |x| x - 3f32); let composed = compose(add_and_multiply, divide_and_subtract); println!("Result is {}", composed(20f32));
} But now I want to take my time to explain this code and how it would look now.

