Rust is not necessarily the easiest language to do function composition. However, it is quite expressive in its robustness to do so. Meaning that we can achieve it through closures and Fn traits. Let's first go over a simpler case, given the functions: fn duplicate(x: i32) -> i32 { x * 2
} fn square(x: i32) -> i32 { x * x
} We want to compose them in a way that we square x after duplicating it. It could easily be done by calling square(duplicate(3)), but this is not actually composition, and makes our life a bit harder to read over a long pipe, so we want to be able to compose it as follows compose(duplicate, square), meaning that we will first duplicate and then square it. Which means that now we have to understand how the compose function works: fn compose(f: impl Fn(i32) -> i32, g: impl Fn(i32) -> i32) -> impl Fn(i32) -> i32 { move |x| g(f(x))
} Compose receives as argument two function implementations of trait Fn, f and g, both of them receive receive as argument a type i32 and return a type i32, then we define h(x) as g(f(x)), which can be transformed into a function by applying move the closure |x| g(f(x)). In the first versions of Rust, this was possible by using the Box pointer. If you read Portuguese, you can learn a bit more about this in my book ProgramaÃ§Ã£o Funcional e Concorrente em Rust . Now that we have defined the compose function, we can use it to compose the two functions we created (Rust Playground) : fn main() { let double_then_square = compose(duplicate, square); println!("Anonymous composition: {}", compose(duplicate, square)(3)); // Output: 36 println!("Named composition: {}", double_then_square(3)); // Output: 36
} There are two ways of using the result from compose: Assign it to a variable and use it as a named function, in our case double_then_square. Call it anonymously with the desired x value, as compose(duplicate, square)(3). Some other use cases that are common in Rust ecosystem: Data Transformation Pipelines : Transforming streams of data in a structured manner. Middleware in Web Frameworks : Combining pre-processing and post-processing logic. Chained Operations : Complex mathematical computations or algorithms.

