To those that know that I complain a lot about functional programming in C++, I know it possible achieve it using function pointers, lambda expressions, and higher-order functions from libraries like <functional> and it looks a lot like what Rust looks like, we just have to consider that impl Fn(i32) -> i32 becomes the function pointer std::function<int(int)>. #include <iostream>
#include <functional> int duplicate(int x) { return x * 2;
} int square(int x) { return x * x;
} std::function<int(int)> compose(std::function<int(int)> f, std::function<int(int)> g) { return [f, g](int x) { return g(f(x)); };
} int main() { auto double_then_square = compose(duplicate, square); std::cout << "Anonymous composition: " << compose(duplicate, square)(3) << std::endl; // Output: 36 std::cout << "Named composition: " << double_then_square(3) << std::endl; // Output: 36 return 0;
} While both Rust and C++ allow function composition, Rustâ€™s type system and functional idioms make the process more expressive and safer. The lack of null pointers and the Option type help avoid runtime errors. Also, we can easily make the compose function more generic with generics, which is not as easy in C++: fn compose<T>(f: impl Fn(T) -> T, g: impl Fn(T) -> T) -> impl Fn(T) -> T { move |x| g(f(x))
}

